import React from 'react'
import MenuFillIcon from 'remixicon-react/MenuFillIcon';
const ToolBar = ({openSidebar}) => {
    return(
        <div className="tool-bar">
            <div className="burger" onClick={openSidebar}>
                <i><MenuFillIcon/></i>
            </div>

        </div>
    )
}
export default ToolBar
